import React from 'react';
import {Button, Col, Container, Image, Row} from "react-bootstrap";

const BoxPage = () => {
    const box = {id:1,name:"Перший бокс", price:233, cbox:'Червона', img:'https://p2.zoon.ru/preview/U3a1uyz3s8zY1zpnQ3x9vg/2400x1500x85/1/7/5/original_5d5d700467cd9302f61f1858_5d5d70990a995.jpg'}

        return (
        <Container>
            <Row className="mt-3">
                <Col md={4}>
                    <Image width={300} height={300} src={box.img}/>
                </Col>
                <Col md={4}>

                </Col>
                <Col md={4}>
                    <Button variant={"outline-info"} className="m-3">Змінити</Button>
                    <Button variant={"outline-danger"} className="m-3">Видалити</Button>
                </Col>
            </Row>
        </Container>
    );
};

export default BoxPage;
